import React from "react";
import classes from "./Card.css";

function Card() {
  fetch(
    "https://www.flickr.com/services/rest/?method=flickr.photos.getPopular&api_key=80d0cf5bb3998d2e51cc12f5d707fede&user_id=190555885%40N03&sort=optional&extras=optional&per_page=optional&page=optional&format=json&nojsoncallback=1",
    {
      method: "GET",
    }
  )
    .then((response) => {
      console.log(response);
    })
    .catch((err) => {
      console.error(err);
    });
  return <div className={classes.Card}></div>;
}

export default Card;
